import Lottie from 'lottie-react';
import animationData from '../src/logoAnimation.json';

const Animation = () => {
    return (
        <div>
            <Lottie animationData={animationData}
                loop={true}
                autoplay={true}
                style={{ height: 400, width: 400 }} />
        </div>
    );
};

export default Animation;
